members-by-name.map:
function(doc) {
  if (doc.type == "member") {
    emit(doc._id, {id: doc['_id'], rev: doc['_rev'], lastName: doc.lastName, firstName: doc.firstName});
  }
}

rates-by-year.map:
function(doc) {
  if(doc.type == 'yearrates') {
    emit(doc._id, {rates: doc.rates, currency: doc.currency, _rev: doc._rev, branch: doc.branch});
  }
}

transmittals-payments.map:
function(doc) {
  if (!doc.type) return;
  if (doc.type == "payment") emit(doc._id, null);
  if (doc.type == "transmittalpayment" && doc._id.substr(doc._id.split(':', 6).join(':').length + 1)) emit(doc._id.substr(doc._id.split(':', 6).join(':').length + 1), null);
}
